import React from 'react';
import {
    View,
    Text
} from 'react-native';

const Place = () => {
    return (
        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
            <Text>Place</Text>
        </View>
    )
}

export default Place;
